scriptlet.script:
if ( scriptletInput ==   scriptletContext.get("server.1.hw.net.1.vlan") ) {
scriptletResult = ""
}
else
{
scriptletResult = scriptletInput
}

if ( scriptletInput == null || scriptletInput == "") 
    scriptletResult = "VCENTER";
else
    scriptletResult = scriptletInput;

var inputs = scriptletInput.split('|');

if (inputs[0] == '0') {
	scriptletResult = inputs[1];
}else if(inputs[0] == '1'){
	scriptletResult = inputs[2];
}else if(inputs[0] == '2'){
	scriptletResult = inputs[3];
}

scriptletResult = "";

var variables = scriptletInput.split("|");

var size = variables[0];

var platform = "";
var os = "";

if (parseInt(size) <= 5 && parseInt(size) >= 1){
		platform = "C";
}else {
	if (variables[1] == 'true') {
		platform = "V";
	}else {
		platform = "P";
	}
}

if (variables[2].substr(0,1) == 'W'){
	os = "W";
}else{
	os = "L";
}


scriptletResult = platform + variables[0] + os
